(3, 'Things You Should Know About Locks and Locksmiths', 'things-you-should-know-about-locks-and-locksmiths', '<p><strong>What are Locksmiths?</strong></p>\n\n<p><img alt=\"\" src=\"https://scontent.fmnl4-5.fna.fbcdn.net/v/t1.0-9/29694966_255053848369599_903069617988399291_n.jpg?_nc_cat=0&amp;_nc_eui2=v1%3AAeE_9Tx2clXw2nF2G5gBwAWC3_58sHVJ4A6zksOCEsQ9GEinBzIuUx8k1DsK_UEkZwmRPXVa_yI49fU6ufD-7N5tXspdJOYMA0v4NoRzmTMXnw&amp;oh=399eb2b00e404f6ed9a86ccb02db5f19&amp;oe=5B67F73E\" style=\"width: 500px; height: 375px; border-width: 3px; border-style: solid;\" /></p>\n\n<p>A locksmith is an individual who works with locks, keys and other security systems. They fix broken locks, make and cut keys, install security systems like alarms, and many more.&nbsp;</p>\n\n<p>A locksmith helps a customer to choose which security system is best for their home or business. They work with locks such as installing bolts, copying or cutting keys, repair or replace malfunctioning locks and locking devices.</p>\n\n<p>Locksmiths also provide assistance to those who are locked out of their homes, businesses, and vehicles.&nbsp;</p>\n', '31,30,28', 'lock, key', 'innerpage.php', '', '', '', '2018-03-26 09:57:19', '0000-00-00 00:00:00', 'draft', NULL, 'page'),
(2, 'Important Locksmith Tips That You Should Remember', 'important-locksmith-tips-that-you-should-remember', '<p>&nbsp;</p>\n\n<p>It may be pretty simple and most of us usually know these safety tips, however, it may still be important that we should be reminded when we could, right? After all, we all know that prevention is better can cure.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Locksmith Tips #1</strong></p>\n\n<center>\n<p><img alt=\"\" src=\"https://scontent.fcrk1-1.fna.fbcdn.net/v/t1.0-9/28056107_242850919589892_6360682268582381261_n.jpg?_nc_cat=0&amp;oh=dade3054f8d7528d542182b8b0cb5a66&amp;oe=5B71C441\" style=\"width: 500px; height: 333px; border-width: 3px; border-style: solid; margin: 5px;\" /></p>\n</center>\n\n<p>It is much easy to search and select the &quot;best&quot; locksmith that you can find if you are not in a panic and have much time to spend scouting professional locksmiths. You have ample time to check the reviews and ask all possible questions you have in mind when you are not yet in an emergency situation.</p>\n\n<p>So what are you waiting for? Go ahead, save the number on your phone so you would always have it when you need it.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Locksmith Tips #2</strong></p>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/-4uTBdaDEiDc/Wo6D5vbfI2I/AAAAAAAAAFY/NLYSuFhowA4pmp6YOyP98M7woew-YOaFwCJoC/w530-h405-n-rw/Locksmith-Tips-%25232.jpg\" style=\"width: 500px; height: 382px; border-width: 3px; border-style: solid;\" /></p>\n\n<p>You may be tempted to hide your spare keys under your doormat, around your garden, under the mailbox, or anywhere around the house. Unfortunately, these secret hiding places are not &quot;secret&quot; to anyone anymore. These are also the places where burglars and robbers search for spare keys.&nbsp;</p>\n\n<p>If you really want to keep your spare key safe, give it to your relative, friend or trusted neighbor. You can also call them immediately when you need your spare key.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Locksmith Tips #3</strong></p>\n\n<p><strong><img alt=\"\" src=\"https://pbs.twimg.com/media/DXA7c2qWsAcmued.jpg\" style=\"width: 500px; height: 288px; border-width: 3px; border-style: solid;\" /></strong></p>\n\n<p>&nbsp;</p>\n\n<p>When moving to a new home, apartment or condominium, make sure to secure your locks immediately. You do not know how many people might have a copy of the key and you surely do not want anyone walking into your new home without your permission.</p>\n\n<p>There are two ways to do that, one is to have the locks re-keyed and the other is to completely change the locks. If you have a tight budget and the locks are still in good condition, you can opt to have them re-keyed instead. But if the locks are showing signs if wear and damages, better to have them replaced.</p>\n', '31,30,28', '', 'innerpage.php', 'Locksmith Tips', 'lock. locksmith', 'It may be pretty simple and most of us usually know these safety tips, however, it may still be important that we should be reminded when we could, right? After all, we all know that prevention is better can cure.', '2018-03-23 09:04:09', '0000-00-00 00:00:00', 'draft', NULL, 'page'),
(4, 'What You Should Know About Safety, Locks and Locksmiths', 'what-you-should-know-about-safety-locks-and-locksmiths', '<p>&nbsp;</p>\n\n<p><strong>What are the states that require locksmiths to be licensed?</strong></p>\n\n<p><img alt=\"\" src=\"https://lh3.googleusercontent.com/-xypNu9pjsYM/WsoP_x02wWI/AAAAAAAABEQ/_w3OknMhkzkiT-LpOjs--rbBRvvRrh4xACJoC/w530-h352-n-rw/c4024deb-127a-4b1f-b303-e9a4a8f9c5b1\" style=\"width: 500px; height: 332px; border-width: 3px; border-style: solid;\" /></p>\n\n<p>Locksmithing is a very sensitive trade and should be dealt only by professionals. Since they will be working on the locking system of our homes, business or cars, there should be a strict restriction on how tradesman should be accredited.&nbsp;</p>\n\n<p>Sadly, according to The Associated Locksmiths Of America (ALOA), only the following states require locksmith licensing:</p>\n\n<p>Alabama<br />\nCalifornia<br />\nConnecticut<br />\nIllinois<br />\nLouisiana&nbsp;<br />\nMaryland&nbsp;<br />\nNebraska<br />\nNevada<br />\nNew Jersey<br />\nNorth Carolina<br />\nOklahoma<br />\nOregon<br />\nTennessee<br />\nTexas<br />\nVirginia</p>\n\n<p>Good thing is that even if you are not located in these states, you can still be sure that you will be dealing with a legit and professional locksmith technicians by calling registred locksmith company.</p>\n\n<p>&nbsp;</p>\n', '31,30,28', '', 'innerpage.php', '', '', '', '2018-03-26 09:59:26', '0000-00-00 00:00:00', 'draft', NULL, 'page'),
(1, 'The Art of Locksmiths', 'the-art-of-locksmiths', '<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"https://upload.wikimedia.org/wikipedia/commons/2/21/Kathmandu-05.JPG\" style=\"width: 200px; float: left; height: 150px; border-width: 2px; border-style: solid; margin: 7px 10px;\" />For the sole purpose of safety, protection and to keep something private, locks were invented to shut doors and things. They have been created in boring, plain, mechanical vogue appearance, with no thought or care to the art world.&nbsp;</p>\n\n<p>Good thing is that, nowadays, there have been many crafts and designs of locks that will make a locksmith proud to say he is part of the world of locks. Decorative and fancy looking locks create a different and nice look on plain doors and houses. Some designs also compliment the furnishings in the house.</p>\n\n<p>Art and creativity have improved the appearances of the very useful locks. And these enhancements seem to boost sales. Truly, the craft of the locksmith is now an artwork in itself.&nbsp;</p>\n\n<p>Unfortunately, the great improvements of locks still don&#39;t mean that once you have it, you are guaranteed to be safe, especially if you are not using it the right way. Locks should be locked to keep you safe and secured. Neglecting or losing keys can pose threat. Anyone who has them can open your locks anytime they want to.&nbsp;</p>\n\n<p>Therefore, one should always remember, no matter how fancy looking your lock is, no matter how great the quality it is, it will render useless without proper care and use.</p>\n\n<p>&nbsp;</p>\n', '31,30,28', 'lock,locks,locks and keys,locksmith', 'innerblog.php', 'The Art of Locksmiths', 'lock,locks,locks and keys,locksmith', 'For the sole purpose of safety, protection and to keep something private, locks were invented to shut doors and things. ', '2017-10-11 16:09:22', '0000-00-00 00:00:00', 'draft', NULL, 'page');
