(8, 'LA County', 'ca', '<p>ALuckyLock is dedicated to providing you with reliable, fast and safe mobile locksmith service, including home lockouts, auto lockouts, and emergency lockouts. We service all major lock brands and associated door hardware. All our locksmithing jobs are done by professional, pre-screened locksmiths quickly, affordably and safely.</p>\n\n<p>Our locksmith technicians will show up at your location fast and on time, every time. The complete job will be quoted to you and must be confirmed by you before any work is done so you will always know what the final price for the job is and are asked to approve it. That is our promise.</p>\n\n<p>At ALuckyLocksmith we are ready to go around the clock, 24 hours a day. If you need an automotive, commercial, or residential locksmith service, we will help you around the clock. Our lock specialists have a local reputation for the best locksmith services in town!&nbsp; We can also help you if you need a 24 hour California locksmith.</p>\n\n<p>Our trained team of dedicated locksmith experts is standing by 24 hours to provide you quality locksmith service. Whenever you need us, we are here for you with complete Locksmith solution to keep your home, property, valuables and loved ones safe.</p>\n\n<p>Whether it&#39;s an emergency or if you are looking to have one of our technicians provide you a free quote, call us now at and experience the difference that great quality locksmith service can make. When you need the job done right, at an affordable price, call to speak with ALuckyLocksmith Specialist today.</p>\n\n<p><strong>Cities we serve and their local numbers:</strong></p>\n\n<ul style=\"margin-left: 40px;\">\n	<li><strong>(213) 542-0972</strong>\n\n	<ul>\n		<li>Dodgertown</li>\n		<li>Los Angeles</li>\n	</ul>\n	</li>\n</ul>\n\n<ul style=\"margin-left: 40px;\">\n	<li><strong>(310) 853-5588</strong>\n\n	<ul>\n		<li>Beverly Hills</li>\n		<li>Carson</li>\n		<li>Compton</li>\n		<li>Culver City</li>\n		<li>El Segundo