(1, 'Home', 'homepage', '<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font face=\"monospace, monospace\">Found yourself locked out of your own home, office or vehicle? We know the frustration that you&rsquo;re going through. We have seen a lot of people experiencing the same situation and we know it&rsquo;s never easy especially if you do not know if the locksmith company you called will arrive or will charge you fair. A lot of locksmith companies are reportedly ripping off customers and we aim to end this kind of scam.</font></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font face=\"monospace, monospace\">We want to change what you think about locksmith industry. This is the main reason why ALuckyLock has been established. It is a network of professional verified local locksmiths who already dealt with a multitude of different situations regarding locks.</font></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font face=\"monospace, monospace\">ALuckyLock advantages include:</font></strong></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font face=\"monospace, monospace\">Live Tracking App with an ETA of your technician</font></strong></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font face=\"monospace, monospace\">There&rsquo;s nothing worse than waiting for a locksmith technician that promises to be in your location in no time. At ALuckyLock, we value your time. We offer live tracking app with an exact time of arrival of your technician so you know when to expect them.</font></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font face=\"monospace, monospace\">No Service Fee and Flat Rate</font></strong></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font face=\"monospace, monospace\">Like you, we hate bait and switch. Don&rsquo;t be trapped by the fake low prices that you see online. AluckyLock stands by no service fee and flat rate regardless of the lock problems you have even if you experience it during holidays or weekends.</font></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font face=\"monospace, monospace\">24 hours availability for 365 days</font></strong></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font face=\"monospace, monospace\">Don&rsquo;t panic, we are here to rescue you. Things happen unexpectedly and you always need to be ready whatever it is that will come in your way like having lock problem in the middle of nowhere. ALuckyLock is specialized in this kind of problem; you do not need to call anyone else but us.</font></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><strong><font face=\"monospace, monospace\">Innovation</font></strong></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font face=\"monospace, monospace\">We make use of the most advanced technology and state of the art tools and techniques in our industry. We make sure that we don&rsquo;t just stand still and continue to be what we were when we started. We do our best to innovate and improve ourselves to benefit our customers.</font></div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\">&nbsp;</div>\n\n<div class=\"gmail_default\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px;\"><font face=\"monospace, monospace\">If you need an expert to help you deal with your current lock situation, call ALuckyLock today!&nbsp;</font>?</div>\n', 'frontpage', 'A Lucky Lock | 24 Hour Locksmith Services', '', 'Our Services: Residential Lockout - $75 | Commercial Lockout - $75 | Auto Lockout - $75 | Home Lock Replacement - $50 | Business Lock Replacement - $75 | Jump Start - $75 | Flat Tire - $75 | Mailbox Services - $75 | Call Us Today: (800) 810-0080 | Visit www.ALuckyLock.com for more information.', NULL, 1),
(2, 'About Us', 'about-us', '<p>Locking out of your own home, office or vehicle can be a downright scary experience. ALuckyLock is here to save your day. We will make a locksmith technician be at your location the same day you call us. We will make sure that you can get back into your home, office or vehicle as soon as possible.</p>\n\n<p>With us, you can be sure to get all of these:</p>\n\n<ul>\n	<li><strong>Live tracking with exact ETA</strong></li>\n</ul>\n\n<p>There is nothing worse than waiting for a locksmith technician to fix your lock. With ALuckyLock, you do not need to guess the location of the locksmith technician because you can track them live and know their exact estimated time of arrival using the latest app JAO by Lookna.com.</p>\n\n<ul>\n	<li><strong>Locksmith network, not a locksmith company</strong></li>\n</ul>\n\n<p>Breaking news about locksmith companies scamming many people in their hard times is everywhere. It&rsquo;s really hard to know who to trust especially when everyone is saying that they are the company that you can trust and count on in times of lock problems. With Aluckylock, you will get the network of local, verified and professional locksmith technicians.</p>\n\n<ul>\n	<li><strong>No Service Fee and Flat Rate</strong></li>\n</ul>\n\n<p>We don&rsquo;t advertise fake prices. What we have in our ads is what you pay. All our charges are flat-rate regardless of the job even during holidays and weekends. We guarantee no bait and switching.</p>\n\n<ul>\n	<li><strong>Availability</strong></li>\n</ul>\n\n<p>Locksmith problems occur unexpectedly. This is the reason why ALuckyLock makes sure that you have a professional locksmith technician that you can count on any time of the day, 24 hours in 365 days.</p>\n\n<ul>\n	<li><strong>State of the art</strong></li>\n</ul>\n\n<p>We are equipped with the most advanced tools and state-of-the-art locksmith equipment so we&rsquo;re always prepared to handle any locksmith emergency.</p>\n\n<ul>\n	<li><strong>Professional Locksmith</strong></li>\n</ul>\n\n<p>You can be sure that all the members of our locksmith network are professional. They bring their experience and knowledge in solving lock, safe and security problems.</p>\n', 'innerpage', 'A Lucky Lock | About Us', '', 'Learn more about our company and the quality of locksmith services we offer. To better know our offered services, you can always call us at our toll-free number.', NULL, 1),
(3, 'Privacy Policy', 'privacy-policy', '<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Last updated: November 28, 2017</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">A Lucky Locksmith (&quot;us&quot;, &quot;we&quot;, or &quot;our&quot;) operates the http://aluckylock.com website (the &quot;Service&quot;).</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">This page informs you of our policies regarding the collection, use and disclosure of Personal Information when you use our Service.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We will not use or share your information with anyone except as described in this Privacy Policy. Privacy Policy from TermsFeed for A Lucky Locksmith.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We use your Personal Information for providing and improving the Service. By using the Service, you agree to the collection and use of information in accordance with this policy. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, accessible at http://aluckylock.com</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Information Collection And Use</span></strong></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">While using our Service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you. Personally identifiable information may include, but is not limited to, your name, other information (&quot;Personal Information&quot;).</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Log Data</span></strong></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We collect information that your browser sends whenever you visit our Service (&quot;Log Data&quot;). This Log Data may include information such as your computer&#39;s Internet Protocol (&quot;IP&quot;) address, browser type, browser version, the pages of our Service that you visit, the time and date of your visit, the time spent on those pages and other statistics.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Cookies</span></strong></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Cookies are files with small amount of data, which may include an anonymous unique identifier. Cookies are sent to your browser from a web site and stored on your computer&#39;s hard drive.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We use &quot;cookies&quot; to collect information. You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Service.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Service Providers</span></strong></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We may employ third party companies and individuals to facilitate our Service, to provide the Service on our behalf, to perform Service-related services or to assist us in analyzing how our Service is used.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">These third parties have access to your Personal Information only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Security</span></strong></p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">The security of your Personal Information is important to us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Links To Other Sites</span></strong></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Our Service may contain links to other sites that are not operated by us. If you click on a third party link, you will be directed to that third party&#39;s site. We strongly advise you to review the Privacy Policy of every site you visit.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Children&#39;s Privacy</span></strong></p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Our Service does not address anyone under the age of 13 (&quot;Children&quot;).</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We do not knowingly collect personally identifiable information from children under 13. If you are a parent or guardian and you are aware that your Children has provided us with Personal Information, please contact us. If we discover that a Children under 13 has provided us with Personal Information, we will delete such information from our servers immediately.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Changes To This Privacy Policy</span></strong></p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">We may update our Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.</span></p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</span></p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">Contact Us</span></strong></p>\n\n<p dir=\"ltr\"><span id=\"docs-internal-guid-7efb2cc6-01e7-da38-9607-2705fe480165\">If you have any questions about this Privacy Policy, please contact us.</span></p>\n', 'innerpage', 'Our Privacy Policy', '', 'Our privacy policy is made for the safety of our customers or site visitors. We came up with this privacy policy to better improve the services we offer.', NULL, 1),
(4, 'Contact Us', 'contact-us', '<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span id=\"docs-internal-guid-7efb2cc6-01e4-62bb-4e59-6b07291621fb\">Our professional team of dedicated locksmith specialists is on call 24 hours a day, 7 days a week for all of your locksmith and security needs. Whether it is an emergency and you need a trained technician right now, or you are looking to book a locksmith expert for a later time, Call us anytime for the best possible service and the most affordable price - Guaranteed!</span></p>\n', 'contact.php', 'Contact Us', '', 'Contact us now if you need immediate locksmith service done the same day. You can call us by phone for emergency services or go to our contact us page to drop us an email.', NULL, 1),
